Accounts_CustomFields_Description:
Devus esti valida JSON kie klavoj estas la kampo-nomoj enhavantaj vortaron de kampo-agordoj. Ekzemplo:<br/><code>{
"rolo": {
"tipo": "elektu",
"defaultValue": "studento",
"ebloj": ["instruisto", "studento"],
"postulita": vera,
"modifiRecordField": {
"tabelo": vera,
"kampo": "roloj"
}
},
"twitter": {
"tipo": "teksto",
"postulita": vera,
"MinLength": 2,
"MaxLength": 10
}
}</code>

Custom_Translations_Description:
Devus esti valida JSON kie klavoj estas lingvoj enhavantaj vortaron de ŝlosilo kaj tradukoj. Ekzemplo:<br/><code>{
"en": {
"Kanaloj": "Salonoj"
},
"pt": {
"Kanaloj": "Salas"
}
}</code>
